  return (
    <div>
      <Alldiv>
        <Input>
          <input className='form-control' style={{ width: "60vw" }} />
        </Input>
      </Alldiv>
    </div>
  );
}

export default Messagesdiv;

const Alldiv = styled.div`
  width: 100%;
